import { BrowserRouter, Route, Routes } from "react-router-dom";
import Home from "./Website/Pages/Home";
import About from "./Website/Pages/About";
import Service from "./Website/Pages/Service";
import Feature from "./Website/Pages/Feature";
import Team from "./Website/Pages/Team";
import Appointment from "./Website/Pages/Appointment";
import Testimonials from "./Website/Pages/Testimonials";
import Contact from "./Website/Pages/Contact";
import PNP from "./Website/Pages/PNP";

import Dashboard from "./Admin/Pages/Dashboard";
import Admin_Login from "./Admin/Pages/Admin_Login";
import Aheader from "./Admin/Components/Aheader";
import Afooter from "./Admin/Components/Afooter";
import Add_Doctors from "./Admin/Pages/Add_Doctors";
import Manage_Doctors from "./Admin/Pages/Manage_Doctors";
import Manage_Patients from "./Admin/Pages/Manage_Patients";
import Add_Medicine from "./Admin/Pages/Add_Medicine";
import Manage_Medicine from "./Admin/Pages/Manage_Medicine";
import Add_Supplies from "./Admin/Pages/Add_Supplies";
import Manage_Supplies from "./Admin/Pages/Manage_Supplies";
function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route
            path="/"
            element={
              <>
                <Home />
              </>
            }
          ></Route>
          <Route
            path="/about"
            element={
              <>
                <About />
              </>
            }
          ></Route>
          <Route
            path="/services"
            element={
              <>
                <Service />
              </>
            }
          ></Route>
          <Route
            path="/feature"
            element={
              <>
                <Feature />
              </>
            }
          ></Route>
          <Route
            path="/ourdoctor"
            element={
              <>
                <Team />
              </>
            }
          ></Route>
          <Route
            path="/appointment"
            element={
              <>
                <Appointment />
              </>
            }
          ></Route>
          <Route
            path="/testimonials"
            element={
              <>
                <Testimonials />
              </>
            }
          ></Route>
          <Route
            path="contact"
            element={
              <>
                <Contact />
              </>
            }
          ></Route>
          <Route
            path="*"
            element={
              <>
                <PNP />
              </>
            }
          ></Route>

          {
            // admin Routes-------------------------------------------------------------------------------
          }

          <Route
            path="/admin-login"
            element={
              <>
                <Admin_Login />
                <Afooter />
              </>
            }
          ></Route>
          <Route
            path="/dashboard"
            element={
              <>
                <Aheader />
                <Dashboard />
              </>
            }
          ></Route>
          <Route
            path="/add-doctors"
            element={
              <>
                <Aheader />
                <Add_Doctors />
              </>
            }
          ></Route>
          <Route
            path="/manage-doctors"
            element={
              <>
                <Aheader />
                <Manage_Doctors />
              </>
            }
          ></Route>
          <Route
            path="/manage-patients"
            element={
              <>
                <Aheader />
                <Manage_Patients />
              </>
            }
          ></Route>
          <Route
            path="/add-medicine"
            element={
              <>
                <Aheader />
                <Add_Medicine />
              </>
            }
          ></Route>
          <Route
            path="/manage-medicine"
            element={
              <>
                <Aheader />
                <Manage_Medicine />
              </>
            }
          ></Route>
          <Route
            path="/add-supplies"
            element={
              <>
                <Aheader />
                <Add_Supplies />
              </>
            }
          ></Route>
          <Route
            path="/manage-supplies"
            element={
              <>
                <Aheader />
                <Manage_Supplies />
              </>
            }
          ></Route>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
